pragma solidity >=0.7.0 <0.9.0;

contract Voting {
    
    struct Voter {
        uint amount;
        uint maturity;
        bool paid;
    }

    struct Vote {
        uint amount;
        uint maturity;
        bool paid;
    }

    struct Campaign {
        string name;
        mapping(address => Party) parties; 
        //startDateTime;
        //endDateTime;
    }

    struct Party {
        string name;
        string sign;
        uint votes;
    }

    mapping(address => Campaign) public campaigns; 


    address public admin;

    constructor() {
        admin = msg.sender;
    }


    function startCampaign() external payable {
        require(msg.sender == admin, 'Only admin can start a campaign');
        //require(campaigns[campaign] != 0, 'Campaign already exists');
